import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

const mapNotes = notes.map(noteItem =>
    <Note 
        key = {noteItem.key}
        title = {noteItem.title}
        content = {noteItem.content}
    />
    )

function App() {
    return (<div>
        <Header />
        <Note 
            title=""
            content=""
        />
        <Footer />
    </div>);
}

export default App;
